import React from "react";
import { useState, useEffect } from "react";
import { Container, Row, Col } from "react-bootstrap";

function Languages() {
  return (
    <Container className="logoContain">
      <Row className="logoRow">
        <Col className="logoCol">
          <h3>Topics I'm Currently Studying</h3>
          <div className="logoBlocks">
            <i class="programming lang-javascript"></i>
            <i class="programming lang-typescript"></i>
          </div>
        </Col>
        <Col className="logoCol">Topics I Have a Solid Foundation In</Col>
        <Col className="logoCol">Topics I'd Like to Learn in the Future</Col>
      </Row>
    </Container>
  );
}

export default Languages;
